@MrWagnerMath @MrCorleyMath @robertqberry I think you two are talking about 2 different meanings of the word game. Isn't English lovely? üòÇ

A single game in a season could be considered one instance of a sport.

A sport falls under the much broader umbrella of games in general.

@MsGillELA @teacherman91 @sheathescholar Agreed. 2 simple changesin formatting would make it clear that you're quoting someone else.

1. Use quotation marks around the full quote.
2. end with "- @sheathescholar"  or "credit: @sheathescholar"

