@pwharris 504-24=480. That's one 24.
480/24=20 that's another twenty.
So 504/24=21 :)

@MrJohnRowe I don't know, John...this truly looks delish, but I have a couple of comments:

(1) I have no idea what that cup thing is you're putting your milk into. üòÇ 

(2) have you ever tried using straight up cocoa and sugar in milk? Results will be A+ 100%.

