But I'll admit that I always double check to see if their claims are true.

Unit prices are the worst for paper towels, though. The units are all different. #amiright?

@inner_moonlight I'm probably the most food-safety-conscious person I know.

Soft/fresh cheese: 3-5 days

But aged cheeses can last practically forever. If it's dry and cracked, you might not _want_ to eat it, but it's still good. if it's moldy, just cut off the mold and keep eating. Seriously.

